import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Typography, 
  Grid, 
  Paper,
  useTheme,
  Link,
  CircularProgress
} from '@mui/material';
import OpenInNewIcon from '@mui/icons-material/OpenInNew';
import { getPairXToken } from '../../utils/helpers';
import axios from 'axios';

const TokenInformation = ({ tokenAddress }) => {
  const [tokenInfo, setTokenInfo] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchTokenInfo = async () => {
      try {
        setLoading(true);
        const response = await axios.get(`https://api.jup.ag/tokens/v1/token/${tokenAddress}`);
        setTokenInfo(response.data);
      } catch (err) {
        console.error('Error fetching token info:', err);
        setError('Failed to fetch token information');
      } finally {
        setLoading(false);
      }
    };

    if (tokenAddress) {
      fetchTokenInfo();
    }
  }, [tokenAddress]);

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', p: 2 }}>
        <CircularProgress size={24} />
      </Box>
    );
  }

  if (error) {
    return <Typography color="error">{error}</Typography>;
  }

  if (!tokenInfo) {
    return <Typography color="text.secondary">Token information not found</Typography>;
  }

  return (
    <Grid container spacing={2}>
      <Grid item xs={12}>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          {tokenInfo.logoURI && (
            <img 
              src={tokenInfo.logoURI} 
              alt={tokenInfo.symbol} 
              style={{ width: 24, height: 24, borderRadius: '50%' }}
            />
          )}
          <Typography variant="subtitle1">{tokenInfo.symbol}</Typography>
        </Box>
      </Grid>
      <Grid item xs={12}>
        <Typography color="text.secondary">Name</Typography>
        <Typography variant="body2">{tokenInfo.name}</Typography>
      </Grid>
      <Grid item xs={12}>
        <Typography color="text.secondary">Decimals</Typography>
        <Typography variant="body2">{tokenInfo.decimals}</Typography>
      </Grid>
      {tokenInfo.daily_volume && (
        <Grid item xs={12}>
          <Typography color="text.secondary">Daily Volume</Typography>
          <Typography variant="body2">
            ${Number(tokenInfo.daily_volume).toLocaleString()}
          </Typography>
        </Grid>
      )}
      {tokenInfo.tags && tokenInfo.tags.length > 0 && (
        <Grid item xs={12}>
          <Typography color="text.secondary">Tags</Typography>
          <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
            {tokenInfo.tags.map((tag, index) => (
              <Typography 
                key={index} 
                variant="body2" 
                sx={{ 
                  bgcolor: 'action.selected',
                  px: 1,
                  py: 0.5,
                  borderRadius: 1
                }}
              >
                {tag}
              </Typography>
            ))}
          </Box>
        </Grid>
      )}
    </Grid>
  );
};

const ExpandedRow = ({ pair }) => {
  const theme = useTheme();
  const pairXToken = getPairXToken(pair);

  const getSolscanLink = (address) => `https://solscan.io/address/${address}`;

  return (
    <Box sx={{ p: 3, backgroundColor: theme.palette.background.default }}>
      <Grid container spacing={3}>
        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Pair Details
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={12}>
                <Typography color="text.secondary">Pair Address</Typography>
                <Link
                  href={getSolscanLink(pair.address)}
                  target="_blank"
                  rel="noopener noreferrer"
                  sx={{ 
                    display: 'flex',
                    alignItems: 'center',
                    gap: 0.5,
                    wordBreak: 'break-all'
                  }}
                >
                  {pair.address}
                  <OpenInNewIcon sx={{ fontSize: '1rem' }} />
                </Link>
              </Grid>
              <Grid item xs={12}>
                <Typography color="text.secondary">Token X Address</Typography>
                <Link
                  href={getSolscanLink(pair.tokenX)}
                  target="_blank"
                  rel="noopener noreferrer"
                  sx={{ 
                    display: 'flex',
                    alignItems: 'center',
                    gap: 0.5,
                    wordBreak: 'break-all'
                  }}
                >
                  {pair.tokenX}
                  <OpenInNewIcon sx={{ fontSize: '1rem' }} />
                </Link>
              </Grid>
              <Grid item xs={12}>
                <Typography color="text.secondary">Token Y Address</Typography>
                <Link
                  href={getSolscanLink(pair.tokenY)}
                  target="_blank"
                  rel="noopener noreferrer"
                  sx={{ 
                    display: 'flex',
                    alignItems: 'center',
                    gap: 0.5,
                    wordBreak: 'break-all'
                  }}
                >
                  {pair.tokenY}
                  <OpenInNewIcon sx={{ fontSize: '1rem' }} />
                </Link>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">Base Fee</Typography>
                <Typography variant="body2">{pair.baseFee}%</Typography>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">Bin Step</Typography>
                <Typography variant="body2">{pair.binStep}</Typography>
              </Grid>
              <Grid item xs={12}>
                <Typography color="text.secondary">Status</Typography>
                <Typography 
                  variant="body2" 
                  sx={{ 
                    color: pair.is_blacklisted ? 'error.main' : 'success.main'
                  }}
                >
                  {pair.is_blacklisted ? 'Blacklisted' : 'Active'}
                </Typography>
              </Grid>
            </Grid>
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Token Information
            </Typography>
            {pairXToken ? (
              <TokenInformation tokenAddress={pairXToken.address} />
            ) : (
              <Typography color="text.secondary">
                No token information available
              </Typography>
            )}
          </Paper>
        </Grid>

        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Performance Metrics
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}>
                <Typography color="text.secondary">30min Volume</Typography>
                <Typography variant="body2">
                  ${Number(pair.volume30min).toLocaleString()}
                </Typography>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">30min Fees</Typography>
                <Typography variant="body2">
                  ${Number(pair.fees30min).toLocaleString()}
                </Typography>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">24h Fees</Typography>
                <Typography variant="body2">
                  ${Number(pair.fees24h).toLocaleString()}
                </Typography>
              </Grid>
              <Grid item xs={6}>
                <Typography color="text.secondary">APR</Typography>
                <Typography variant="body2">
                  {Number(pair.apr).toLocaleString()}%
                </Typography>
              </Grid>
            </Grid>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default ExpandedRow;
